import React from 'react';
import { Link } from 'react-router-dom'; 

const Navbar = () => {
  return (
    <nav className="bg-customGray.dark p-4">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-white font-bold text-2xl">Your Logo</Link>
        <div className="lg:hidden">
          {/* Mobile Menu Button */}
          <button
            className="text-white hover:text-gray-300 focus:outline-none focus:text-gray-300"
            onClick={() => alert("Toggle mobile menu here")}
          >
            ☰
          </button>
        </div>
        <div className="hidden lg:block space-x-4">
          <Link to="/" className="text-white">Home</Link>
          <Link to="/dashboard" className="text-white">Dashboard</Link>
          <Link to="/about" className="text-white">About</Link>
          <Link to="/login" className="text-white">Login</Link>
          <Link to="/signup" className="text-white">Signup</Link>
          <button className="bg-red-500 text-white px-4 py-2 rounded">Sign Out</button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
